		"dcterms:extent": require_utils.generateArrayOrSingular(itemOrFeed.extents, itemOrFeed.extent, require_utils.generateCdataString),
		"dcterms:format": require_utils.generateArrayOrSingular(itemOrFeed.formats, itemOrFeed.format, require_utils.generateCdataString),
		"dcterms:hasFormat": require_utils.generateArrayOrSingular(itemOrFeed.hasFormats, itemOrFeed.hasFormat, require_utils.generateCdataString),
		"dcterms:hasPart": require_utils.generateArrayOrSingular(itemOrFeed.hasParts, itemOrFeed.hasPart, require_utils.generateCdataString),
		"dcterms:hasVersion": require_utils.generateArrayOrSingular(itemOrFeed.hasVersions, itemOrFeed.hasVersion, require_utils.generateCdataString),
		"dcterms:identifier": require_utils.generateArrayOrSingular(itemOrFeed.identifiers, itemOrFeed.identifier, require_utils.generateCdataString),
		"dcterms:instructionalMethod": require_utils.generateArrayOrSingular(itemOrFeed.instructionalMethods, itemOrFeed.instructionalMethod, require_utils.generateCdataString),
