		"dcterms:isPartOf": require_utils.generateCdataString(itemOrFeed.isPartOf),
		"dcterms:isReferencedBy": require_utils.generateCdataString(itemOrFeed.isReferencedBy),
		"dcterms:isReplacedBy": require_utils.generateCdataString(itemOrFeed.isReplacedBy),
		"dcterms:isRequiredBy": require_utils.generateCdataString(itemOrFeed.isRequiredBy),
		"dcterms:issued": require_utils.generateRfc3339Date(itemOrFeed.issued),
		"dcterms:isVersionOf": require_utils.generateCdataString(itemOrFeed.isVersionOf),
		"dcterms:language": require_utils.generateArrayOrSingular(itemOrFeed.languages, itemOrFeed.language, require_utils.generateCdataString),
		"dcterms:license": require_utils.generateArrayOrSingular(itemOrFeed.licenses, itemOrFeed.license, require_utils.generateCdataString),
		"dcterms:mediator": require_utils.generateArrayOrSingular(itemOrFeed.mediators, itemOrFeed.mediator, require_utils.generateCdataString),
