		"dcterms:references": require_utils.generateCdataString(itemOrFeed.references),
		"dcterms:relation": require_utils.generateArrayOrSingular(itemOrFeed.relations, itemOrFeed.relation, require_utils.generateCdataString),
		"dcterms:replaces": require_utils.generateCdataString(itemOrFeed.replaces),
